import logo from './logo.svg';
import  Compteur  from './Clock';
import {Form} from './Form';
import './App.css';
import  Client  from "./pages/Choix_page/Client";
import  Back_office  from "./pages/Choix_page/Back_office";
import { Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <>
    <Link to={"/"}>
      <div className='box-ensemble'>
        <Link to="/Client" className='chemin'>
          <Client/>
        </Link>

        <Link to="/Back_office" className='chemin'>
          <Back_office/>
        </Link>

      </div>
    </Link>


  <Routes>
    <Route path="/">
      <Route path="Client" />
      <Route path="Back_office" />
   </Route>
  </Routes>
    </>
  )
}

export default App;
